					"contentValues": {
						"tagData": ["<p>Don't need to touch this</p>"],
						"sectionTitle0": "2.1 Scope of Work",
						"ckEditData": {
							"div1": "<p>To achieve this objective, Benchmark personnel conducted an assessment generally consistent with, but not limited to, the requirements of 40 Code of Federal Regulations (CFR) Part 312-Standards and Practices for All Appropriate Inquiries (AAI), herein referred to as the Environmental Agency's (EPA) AAI Rule and American Society for Testing and Materials (ASTM) Standard E 1527-13, and Verizon Wireless Scope of Work No. 2 Environmental Due Diligence Services under Verizon Wireless contract #ieMA-00104-2015, dated September 30, 2015.</p><p><br/>According to the ASTM, the term \"recognized environmental condition\" means the presence or likely presence of any hazardous substances or petroleum products in, on, or at a property: (1) due to any release to the environment; (2) under conditions indicative of a release to the environment; or (3) under conditions that pose a material threat of a future release to the environment. The term \"controlled recognized environmental condition\" means a recognized environmental condition resulting from a past release of hazardous substances or petroleum products that has been addressed to the satisfaction of the applicable regulatory authority (for example, as evidenced by the issuance of a no further action letter or equivalent, or meeting risk-based criteria established by regulatory authority), with hazardous substances or petroleum products allowed to remain in place subject to the implementation of required controls (for example, property use restrictions, activity and use limitations, institutional controls, or engineering controls). The term \"historical recognized environmental condition\" means a past release of any hazardous substances or petroleum products that has occurred in connection with the property and has been addressed to the satisfaction of the applicable regulatory authority or meeting unrestricted use criteria established by a regulatory authority, without subjecting the property to any required controls.<br/><br/>The assessment included visual observation of the subject property, limited observations of surrounding properties, review of historical land use, interviews, and review of a commercial environmental regulatory database report and related sources.</p>"
						}
					}
