					"sectionTitle0": "Section 2 Introduction",
					"ckEditData": {
						"div1": "<p>Benchmark Environmental Consultants (Benchmark) of Dallas, Texas performed a Phase I Environmental Site Assessment (ESA) for Cellco Partnership and its controlled affiliates doing business as Verizon Wireless (Verizon Wireless) on&nbsp;<font color=\"#ff0000\">a 100' x 100' tract of undeveloped land</font>&nbsp;located at {PropertyAddress} in {PropertyCity}, {PropertyCounty}, {PropertyState}. Verizon Wireless proposes to&nbsp;<font color=\"#ff0000\">construct a 151' monopole tower, associated telecommunications compound, and access road</font>.&nbsp;<font color=\"#ff0000\">Mr</font>./<font color=\"#ff0000\">Ms</font>. <font color=\"#ff0000\">{ProjectManager}, Project Manager with Benchmark, performed the site reconnaissance on {SiteVisitDate} and performed the historical research for the Phase I ESA. ////OR The site reconnaissance was performed on {SiteVisitDate} by&nbsp;</font><font color=\"#ff0000\">Mr./Ms. {SiteAssessor}, Project Manager with Benchmark, and historical research for the Phase I ESA was performed by&nbsp;Mr./Ms</font><font color=\"#ff0000\">. {ProjectManager}, Project Manager with Benchmark</font>. Report oversight was performed by Mrs. Brandi Ballard, Environmental Department Coordinator, who meets the current standards of an Environmental Professional. The location of the subject property is indicated on Appendix C, Site Vicinity Map.</p>"
					}
