				"sectionName": "Geologic, Hydrogeologic, Hydrologic, and Topographic Conditions",
				"sectionGUID": "9bc1f635-dd48-11e5-b5c1-0e29ed3d2a45",
				"sectionData": {
					"contentValues": {
						"tagData": ["<p>Geologic, hydro-geologic, hydrologic and topographic conditions of the property; and of the surrounding area.</p>"],
						"importData": [{
							"destinationSectionID": "25",
							"destinationDivID": "div1",
							"isHardcoded": false,
							"originDivID": "div1",
							"originSectionID": "107"
						}],
						"sectionTitle0": "3.6 Geologic, Hydrogeologic, Hydrologic, and Topographic Conditions",
						"ckEditData": {
							"div1": "<p>Based on a review of the U.S. Geological Survey (USGS) 7.5-minute topographic quadrangle map <font color=\"#ff0000\">Waldheim, Louisiana (1983)</font>, the subject property is depicted as <font color=\"#ff0000\">//////////. Surrounding areas are depicted as /////////</font>. A copy of the topographic map is located in Appendix D, Historical Research Documentation.</p><p>&nbsp;</p><ul><li>The topographic map review did <font color=\"#ff0000\">not</font> indicate obvious evidence of recognized environmental conditions, historical recognized environmental conditions, or potential environmental concerns associated with the subject property and surrounding properties.</li></ul> <p>The subject property area is <font color=\"#ff0000\">generally flat and slopes gently to the southwest</font>. Storm water flows across the subject property <font color=\"#ff0000\">gently to the southwest towards a drainage ditch</font>. The nearest surface water body is <font color=\"#ff0000\">a pond located approximately 1,000' to the northeast</font> of the subject property. Subject property elevation is approximately <font color=\"#ff0000\">46'</font> above mean sea level (AMSL).</p> <p style=\"\">Based on a review of the U.S. Department of Agriculture Natural Resources Conservation Service Online Web Soil Survey, the soils at the subject property are classified as&nbsp;<font color=\"#ff0000\">Lake Charles clay, 0-1 percent slopes.&nbsp;</font></p><p>&nbsp;</p><ul><li><font color=\"#ff0000\">The Lake Charles series consists of very deep, moderately well drained, very slowly permeable soils that formed in clayey sediments. These soils are on broad coastal prairies. Slopes are mainly less than 1 percent, but range from 0 to 8 percent. Lake Charles soils are on broad, nearly level areas or narrow moderately sloping areas along side slopes of drainageways. Slopes are plane, and gradients are mainly less than 1 percent but range to 8 percent. The soil formed in clayey flood basin deposits on alluvial plains or deltas of the Beaumont Formation of Pleistocene Age. Mean annual precipitation is 44 to 50 inches and is evenly distributed throughout the year. Mean annual temperature is 70 to 72 degrees F. Frost free days range from 270 to 290 and elevation ranges from 10 to 100 feet above sea level. Thornthwaite annual P-E indices ranges from 60 to 70. The soils are moderately well drained and permeability is very slow. Water enters the soil rapidly when cracked, but very slow when wet and cracks are closed. Runoff is low on 0 to 1 percent slopes, medium on 1 to 3 percent slopes, high on 3 to 5 percent slopes, and very high on 5 to 8 percent slopes. The Lake Charles series is mainly in cultived and native pasture. Crops are corn, cotton, rice, and grain sorghum. Native grasses include little bluestem, indiangrass, eastern gamagrass, switchgrass, big bluestem, and brownseed paspalum. Most areas have scattered live oak, water oak, elm, hackberry, and huisache trees. Pine trees have encroached in some areas.</font></li></ul> <p style=\"\">The hydrogeologic gradient at the subject property, is not known. The hydrogeologic gradient, if present, would likely vary depending on topography of the bedrock geology, underground structures, and other variables not addressed as a part of this scope of work. Without site-specific groundwater monitoring wells, the hydrogeologic gradient beneath the subject property cannot be ascertained. The regional hydrogeologic gradient, as interpreted by surface topography and drainage patterns, is presumed to be to the <font color=\"#ff0000\">south-southeast</font>. <font color=\"#ff0000\">////&nbsp;</font><font color=\"#ff0000\">Based on well data provided by EDR, the presumed local hydrogeologic gradient at the subject property is expected to flow towards the south-southeast.&nbsp;However, the actual hydrogeologic gradient may be locally affected by influencing factors such as the topography of the bedrock geology, underground structures, and other variables not addressed as a part of this scope of work.&nbsp;The regional hydrogeologic gradient, as interpreted by surface topography and drainage patterns,&nbsp;is presumed to be to the south-southeast.</font></p><p style=\"\">&nbsp;</p><p style=\"\">A major aquifer is defined as one which yields large quantities of water in a comparatively large area of the state. The state designated major aquifer in this region of the state is the <font color=\"#ff0000\">Gulf Coast Aquifer</font>.</p><p style=\"\">&nbsp;</p><ul><li><font color=\"#ff0000\">The Gulf Coast Aquifer covers all or part of 53 counties, and is composed of Miocene and Holocene sediments of the Catahoula,Oakville, Lagarto, Goliad, Willis, Lissie, and Beaumont Formations, as well as overlying surficial deposits. The aquifer consists of alternating beds of clay, silt, sand, and gravel which are hydrogeologically connected and form a large, leaky artesian aquifer system. These sediments were deposited under fluvial, deltaic, and shallow marine environments. The principle water bearing units are the Goliad, Willis, and Lissie Formations. The thickness of the formation ranges from a few feet in the area of the outcrop to several thousand feet near the coastline. Normally, water of better quality occurs in the aquifer from the San Antonio River basin northeastward to Louisiana. In this area, usable quality water reaches a maximum of 3,200 feet below land surface. Water quality from the Gulf Coast Aquifer is acceptable for most municipal, irrigation, and industrial purposes.</font></li></ul><p>&nbsp;</p><p style=\"\">A minor aquifer is defined as one which yields large quantities of water in small areas or relatively small quantities of water in large areas of the state. <font color=\"#ff0000\">No minor aquifers are listed for this area of the state. /// Be sure to double check this</font></p> <p>The underlying formation in this area is the <font color=\"#ff0000\">Beaumont Formation</font>.</p><p>&nbsp;</p><ul><li><font color=\"#ff0000\">The Beaumont Formation consists of clay and mud of low permeability (light-to dark-gray and bluish-to greenish-gray clay and silt, intermixed and interbedded). The Beaumont Formation contains beds and lenses of fine sand, decayed organic matter, and many buried organic-rich, oxidized soil zones that contain calcareous and ferruginous nodules. In addition, the formation includes plastic and compressible clay and mud deposited in flood basins, coastal lakes, and former stream channels on a deltaic plain. Thickness is 5-10 m along north edge of outcrop and thickens southward in subsurface to more than 100 m.</font></li></ul>"
						}
					}
				},
