						"sectionTitle0": "6.1 Interview Owner(s)",
						"ckEditData": {
							"div1": "<p><font color=\"#ff6666\">Mr. James Stegall, subject property owner, </font>was contacted on<font color=\"#ff6666\"> December 3, 2015 </font>for information regarding current and historical use of the property and any environmental issues and/or incidents.<font color=\"#ff6666\"> Mr. Stegall </font>stated the property is currently<font color=\"#ff6666\"> pasture land </font>and was historically<font color=\"#ff6666\"> rice fields and pasture land. Mr. Stegall </font>stated that<font color=\"#ff6666\"> he is not aware of any above ground or underground storage tanks, water wells, oil/gas wells, or any significant releases of petroleum products or hazardous waste on the property. </font>In addition, <font color=\"#ff6666\">Mr. Stegall is not </font>aware of any pending, threatened, or past litigation, any pending, threatened, or past administrative proceedings, or any notices from any governmental entity regarding possible violation of environmental laws relevant to hazardous substances or petroleum products. <font color=\"#ff6666\">Mr. Stegall </font>was forthcoming with the provided information. A copy of the Owner Interview is provided in Appendix H, Interview Documentation.</p>"
						}
