			"sectionName": "Interviews",
			"sectionGUID": "9bc228ea-dd48-11e5-b5c1-0e29ed3d2a45",
			"sectionData": {
				"contentValues": {
					"tagData": ["<p>The Supplier shall interview with the owner(s), occupants of neighboring properties who might have information concerning previous uses of the subject property, key site manager(s), as well as occupants of the site to obtain information and documents reflecting uses and conditions of the site. These interviews shall result in the collection of information necessary to achieve the objectives and performance factors of the AAI regulations. The interview process shall include, but not be limited to, the following:</p><p>&nbsp;</p><p>1. all items identified in Section 1, Paragraph A Items 1 through 30 of this scope, including past and current history for each.</p><p>&nbsp;</p><p>2. all documents in connection with the property, including but not limited to:</p><ul><li>prior environmental site assessment reports</li><li>environmental audit reports</li><li>environmental permits</li><li>registrations for underground and above-ground storage tanks</li><li>material safety data sheets</li><li>community right-to-know plans</li><li>environmental safety plans</li><li>geological or hydro-geologic reports</li><li>notices of violation from government agencies</li><li>notifications and reports regarding hazardous waste generation any proceedings against the property, including but not limited to:</li><li>pending, threatened or past litigation regarding hazardous substances or petroleum products in, on or from the property.</li><li>any pending, threatened or past administrative proceedings regarding hazardous substances or petroleum products in, on, or from the property.</li><li>any notices from any government entity regarding any possible violation of environmental laws or possible liability relating to hazardous substances.</li></ul><p>The Supplier shall note whether the interviewee was forthcoming with information.</p>"],
					"sectionTitle0": "Section 6 Interviews",
					"ckEditData": {
						"div1": "<p>Benchmark contacted representatives knowledgeable with the subject property to obtain information on recognized environmental conditions or environmental concerns, if any, at the subject property. Copies of the communications can be found in Appendix H, Interview Documentation.</p>"
					}
				}
			},
