							"ckEditData": {
								"div1": "<p>Available information relative to the subject property was collected and reviewed to evaluate past land use of the subject property. Based on a review of the aerial photographs (dated <font color=\"#ff0000\">1944, 1953, 1968, 1979, 1989, 1995, 2004, 2005, 2006, 2010, and 2012</font>), topographic maps (dated <font color=\"#ff0000\">1965, 1973, and 1995</font>), city directories (dated <font color=\"#ff0000\">1970, 1973, 1980, 1985, 1990, 1995, 2000, 2005, and 2010</font>), <font color=\"#ff0000\">and Sanborn maps (dated 1885, 1890, 1905, 1925, and 1930),</font> the subject property has historically been <font color=\"#ff0000\">undeveloped land</font>.</p><p>&nbsp;</p><p><font color=\"#ff0000\">No recognized environmental conditions, historical recognized conditions, or environmental concerns were identified during the historical information review of the subject property.</font></p>"
							},
