				"contentValues": {
					"sectionTitle0": "Section 9 Conclusions",
					"ckEditData": {
						"div1": "<p>Benchmark performed the Phase I ESA in conformance with, but not limited to, the requirements of 40 Code of Federal Regulations (CFR) Part 312- Standards and Practices for All Appropriate Inquiries (AAI), herein referred to as the Environmental Protection Agency (EPA's) AAI Rule, American Society for Testing and Materials (ASTM) Standard E 1527-13, and Verizon Wireless Scope of Work No. 2&nbsp;<i>Environmental Due Diligence Services </i>under&nbsp;Verizon Wireless contract #ieMA-00104-2015,&nbsp;dated September 30, 2015 on&nbsp;<font color=\"#ff0000\">a&nbsp;</font><font color=\"#ff0000\">70' x 25' tract of raw land</font> located at {PropertyAddress} in {PropertyCity}, {PropertyCounty}, {PropertyState}. Verizon Wireless&nbsp;proposes to <font color=\"#ff0000\">construct a 109' monopole tower and associated telecommunications compound</font>.&nbsp;The subject property is located at an approximate latitude&nbsp;<font color=\"#ff0000\">29</font> <font color=\"#ff0000\">46</font>' <font color=\"#ff0000\">1.95</font>\" North and longitude&nbsp;<font color=\"#ff0000\">95</font> <font color=\"#ff0000\">23</font>' <font color=\"#ff0000\">59.90</font>\" West.</p><p>&nbsp;</p><p>The legal description for the parent property is as follows: <font color=\"#ff0000\">Lots 6, 7, 8, 9, and 10, in Block 7, of Leverkuhn Addition, Harris County, Texas, according to the map recorded in Volume 1, Page 41, Map Records</font>.</p><p>&nbsp;</p><p>Any exceptions to, or deletions from, this practice are described in Sections 2,&nbsp;Limitations &amp; Exceptions.<br/>&nbsp;<br/><font color=\"#ff0000\">This assessment has revealed no evidence of recognized environmental conditions, historical recognized environmental conditions, controlled recognized environmental conditions, or potential environmental concerns in connection with the subject property</font>.</p>"
					}
				}
